import React from 'react'
import Logo from 'src/img/purpalien.png'

const LogoSearch = () => {
  return (
    <div className="LogoSearch">
        <img src={Logo} alt=""/>
        <div className="Search"></div>
    </div>
  )
}

export default LogoSearch
